import { Route, Routes } from "react-router-dom";
import { useState } from "react";
import TagPage from "./TagPage";
import Home from "./Home.js";
import AddPage from "./AddPage.js";
import Layout from "./Layout";

//practice using context by making page and set page in a context

function App() {
  //try a nested route with layout and outlet
  //outer routes and then inner is home and layout and inside of layout is add and tag (layout includes nav and outlet)
  return (
    <>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/data" element={<Layout />}>
          <Route path="add" element={<AddPage />} />
          <Route path="tag" element={<TagPage />} />
        </Route>
      </Routes>
    </>
  );
}

export default App;
